import React from "react";
import { BrowserRouter } from "react-router-dom";

import Question from "./components/Question";
import Start from "./components/Start";

export default function App() {
  return (
    <div className="app">
      <BrowserRouter>
        <Question />
        <Start />
      </BrowserRouter>
    </div>
  );
}
